import React, { useState } from 'react';
import './App.css';
import Session from './Session';
function App() {
  const [curr_user, set_curr_user] = useState()


  return(
    <div>
      <form>
        <input type="text" placeholder="User Id"/>
        <button onClick={set_curr_user()}> Submit </button>
      </form>

    <Session/>
    </div>

  );
}

export default App;
